import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

function CriarOrcamento() {
  const navigate = useNavigate();

  // Estados para o formulário de orçamento
  const [clienteId, setClienteId] = useState('');
  const [distancia, setDistancia] = useState('');
  const [quantidadeEletrocalha, setQuantidadeEletrocalha] = useState('');
  const [quantidadeDutoCanaduto, setQuantidadeDutoCanaduto] = useState('');
  const [quantidadeEletrodutoPVC, setQuantidadeEletrodutoPVC] = useState('');
  const [desviosCanaduto, setDesviosCanaduto] = useState('');
  const [desviosPVC, setDesviosPVC] = useState('');
  const [conduletes, setConduletes] = useState('');
  const [quantidadeCurvas, setQuantidadeCurvas] = useState('');
  const [observacao, setObservacao] = useState('');

  // Função para salvar um orçamento
  const handleSalvarOrcamento = async (e) => {
    e.preventDefault();

    const orcamento = {
      clienteId,
      distancia: parseFloat(distancia),
      quantidadeEletrocalha: parseFloat(quantidadeEletrocalha),
      quantidadeDutoCanaduto: parseFloat(quantidadeDutoCanaduto),
      quantidadeEletrodutoPVC: parseFloat(quantidadeEletrodutoPVC),
      desviosCanaduto: parseInt(desviosCanaduto),
      desviosPVC: parseInt(desviosPVC),
      conduletes: parseInt(conduletes),
      quantidadeCurvas: parseInt(quantidadeCurvas),
      observacao
    };

    try {
      const response = await fetch('http://localhost:3000/orcamentos', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(orcamento)
      });
      if (!response.ok) throw new Error('Erro ao salvar orçamento');
      alert('Orçamento criado com sucesso!');
      navigate('/orcamentos'); // Redireciona para a lista de orçamentos
    } catch (error) {
      console.error('Erro:', error);
      alert('Erro ao salvar orçamento');
    }
  };

  return (
    <div>
      <h1>Criar Orçamento</h1>
      <form onSubmit={handleSalvarOrcamento}>
        <div>
          <label>ID do Cliente:</label>
          <input type="text" value={clienteId} onChange={(e) => setClienteId(e.target.value)} required />
        </div>
        <div>
          <label>Distância (m):</label>
          <input type="number" value={distancia} onChange={(e) => setDistancia(e.target.value)} required />
        </div>
        <div>
          <label>Quantidade de Eletrocalha (m):</label>
          <input type="number" value={quantidadeEletrocalha} onChange={(e) => setQuantidadeEletrocalha(e.target.value)} required />
        </div>
        <div>
          <label>Quantidade de Duto Canaduto (m):</label>
          <input type="number" value={quantidadeDutoCanaduto} onChange={(e) => setQuantidadeDutoCanaduto(e.target.value)} required />
        </div>
        <div>
          <label>Quantidade de Eletroduto PVC (m):</label>
          <input type="number" value={quantidadeEletrodutoPVC} onChange={(e) => setQuantidadeEletrodutoPVC(e.target.value)} required />
        </div>
        <div>
          <label>Desvios Canaduto:</label>
          <input type="number" value={desviosCanaduto} onChange={(e) => setDesviosCanaduto(e.target.value)} required />
        </div>
        <div>
          <label>Desvios PVC:</label>
          <input type="number" value={desviosPVC} onChange={(e) => setDesviosPVC(e.target.value)} required />
        </div>
        <div>
          <label>Conduletes:</label>
          <input type="number" value={conduletes} onChange={(e) => setConduletes(e.target.value)} required />
        </div>
        <div>
          <label>Quantidade de Curvas:</label>
          <input type="number" value={quantidadeCurvas} onChange={(e) => setQuantidadeCurvas(e.target.value)} required />
        </div>
        <div>
          <label>Observação:</label>
          <textarea value={observacao} onChange={(e) => setObservacao(e.target.value)} required />
        </div>
        <button type="submit">Salvar Orçamento</button>
      </form>
    </div>
  );
}

export default CriarOrcamento;
